def factorial(n: int) -> int:
    """Compute n! for non-negative integers."""
    if n < 0:
        raise ValueError("Factorial is undefined for negative integers.")
    result = 1
    for value in range(2, n + 1):
        result *= value
    return result


if __name__ == "__main__":
    print(factorial(3))

